import { configureStore } from "@reduxjs/toolkit";
import authReducer from "./lib/auth/authSlice";
import socketReducer from "./lib/webSocket/socketSlice";

export const store = configureStore({
    reducer:{
        auth: authReducer,
        socket: socketReducer,
    }
})
